import React from 'react';
import './Navigation.css';

const Navgation = () => {
    return (
        <nav>
            <ul className = 'main-nav'>
                <li className='push f3 link dim black pa2 pointer'>Logo</li>
                <li className='f3 link dim black pa2 pointer underline'>Sign Out</li>
            </ul>
        </nav>
    )
}

export default Navgation;
